import React from 'react'
import 'Playlist.css'

const Nome = [
  {id: 1, autor: Pedro}
]

const Playlists = () => {
  return (
    <div>
      <div>
        <div className='banner'>
          <h1>Sou Triste e DECADENTE</h1>
          <p className='autor'>Por: <Nome /></p>
          <p className='numeroMusicas'></p>
        </div>
      </div>
    </div>
  )
}



export default Playlists;
